INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004151', 'Pavé Le Charolais Bœuf Emmental', 'UNE GARNITURE (52%) composée de : Viande bovine française de race charolaise 53% ; Sauce burger 26% (huile de colza, eau, _moutarde_ (eau, vinaigre d\'alcool, graines de _moutarde_, sel, acidifiant E330, sucre, épice, antioxydant : disulfite de potassium , extraits naturels d\'épices), sucre, vinaigre d\'alcool, concentré de tomates, amidon transformé de pomme de terre, sel, jaune d\'_oeuf_, ail, jus de citron concentré, ciboulette, persil, épaississants : gomme xanthane et gomme de cellulose, conservateur : sorbate de potassium) ; Emmental fondu 21% (_fromages_ dont _emmental_ 10%, eau, _beurre_, poudre de _lait_ écrémé, protéines de _lait_, épaississants : gomme xanthane et farine de graines de caroube). UN PAIN SPECIAL (48 %) fabriqué par nos boulangers à partir de : farine de _blé_, eau, huile de colza, levure, sel, sucre, _gluten_ de blé.', 'https://static.openfoodfacts.org/images/products/336/765/100/4151/front_fr.27.400.jpg', '15', '5', '28', '4.2', '', '13', '1.2', '0.47244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004175', 'Pavé Campagnard', 'PAIN AUX GRAINES 50% : Farine de blé, eau, graines 32% (graines de tournesol, lin brun, quinoa rouge, graine de pavot), huile de colza, levure, levain de seigle désactivé, sel, farine d\'orge torréfiée, gluten de blé, extrait d\'acérola et farine d\'orge malté torréfiée. GARNITURE : Poulet rôti traité en salaison 19,4% (Filet de poulet origine Brésil, eau, sel, dextrose, stabilisants : E451- E407, Sauce au fromage blanc et à la moutarde à l\'ancienne 16,7% (Fromage blanc 42%, eau, huile de colza, moutarde à l\'ancienne 1,7% (Eau, graines de moutarde, vinaigre, sel), moutarde de Dijon (eau, graines de moutarde, vinaigre, sel, acidifiant E330, antioxydant : disulfite de potassium), vinaigre, jaune d\'ceuf, amidon transformé de pomme de terre, sucre, sel, épaississants: gomme guar-gomme xanthane, conservateur: sorbate de potassium), Emmental fondu 13.9% (fromages dont Emmental 6,5%, beurre, protéines de lait, eau, épaississants : gomme de xanthane-farine de graine de caroube, poudre de lait), (% exprimes sur le produit fini), Informations en gras destinées aux personnes allergiques. Traces éventuelles de poisson, crustacé, sésame, céleri, soja, fruits à coque.', 'https://static.openfoodfacts.org/images/products/336/765/100/4175/front_fr.17.400.jpg', '13', '4.3', '25', '1.9', '', '15', '1.2', '0.47244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004205', 'Jambon fumé aop', 'Garniture (55 %) : jambon cuit fumé 43 % : jambon de porc, eau, sel, dextrose, sirop de glucose, arômes, stabilisants : E451-E450, antioxydant : érythorbate de sodium, conservateur : E250. Cantal AOP 23,5 % : _lait_ de vache pasteurisé, sel, présure animale, ferments lactiques. Mayonnaise moutardée 19 % : huile de colza, _moutarde_ de Dijon 1,8 % (eau, graines de _moutarde_, vinaigre, sel, acidifiant E330, antioxydant : disulfite de potassium), eau, jaune d\'_oeuf_, vinaigre, sel, sucre, épaississants : gomme guar et xanthane, amidon transformé de pomme de terre. Salade. Pain de mie spécial campagne (45 %) : farine de _blé_, eau, farine de _seigle_, levains issus de farine de _seigle_ et de _blé_ malté, huile de colza, _gluten_, sel, levure, vinaigre, farine de fèves, malt d\'orge, farine de _blé_ malté, extrait d\'acérola.', 'https://static.openfoodfacts.org/images/products/336/765/100/4205/front_fr.5.400.jpg', '13', '2.8', '19.9', '1.7', '', '12.1', '1.4', '0.551181102362205', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004212', 'Escales Gourmandes Coppa Emmental', 'Garniture (55%) : coppa au sel sec 28% : échine de porc, sel sec, dextrose, sirop de glucose, arômes naturels, épices, ail, sucre, conservateurs : lactate de sodium, acétate de sodium, acide ascorbique, ascorbate de sodium; nitrate de potassium, E250, ferments. Sauce au _fromage blanc_ (24%) : _fromage blanc_, huile de colza, eau, vinaigre, amidon transformé de pomme de terre, jaune d\'_oeuf_, sucre, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, acidifiant : E330, antioxydant : disulfite de potassium), sel, épaississants : gomme guar, gomme xanthane, conservateur : sorbate de potassium. _Emmental_ 19%. Tomate. Salade. Pain de mie spécial campagne (45%) : farine de _blé_, eau, farine de _seigle_, levains issus de farine de _seigle_ et de _blé_ malté, huile de colza, _gluten_, sel, levure, vinaigre, farine de fèves, malt d\'orge, farine de _blé_ malté, extrait d\'acérola.', 'https://static.openfoodfacts.org/images/products/336/765/100/4212/front_fr.8.400.jpg', '9.1', '2.2', '21.6', '2.2', '', '12.8', '1.69926', '0.669', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004229', 'Poulet rôti Gruyère de France IGP Pain spécial campagne moelleux', 'Garniture (55%) : Filet de poulet rôti traité en salaison 38% : Filet de poulet, eau, acidifiants : lactate et acétate de potassium, dextrose, amidon transformé de pomme de terre, sel, stabilisant : E451, sucre brun, antioxydant : érythorbate de sodium, _Gruyère_ de France IGP 24% (_lait_ de vache, sel, ferments lactiques, présure). Mayonnaise allégée en matière grasse : eau, huile de colza 5%, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, acidifiant : E330 et antioxydant : disulfite de potassium), jaune d\'_œuf_, vinaigre, amidon transformé de pomme de terre, sucre, sel, épaississants : gomme guar et xanthane, conservateur : sorbate de potassium. Salade 14%. (% exprimés sur la garniture). Pain de mie spécial campagne (45%) : farine de _blé_, eau, farine de _seigle_, levains issus de farine de _seigle_ et de _blé_ malté, huile de colza, _gluten_, sel, levure, vinaigre, farine de fèves, malt d\'orge, farine de _blé_ malté, extrait d\'acérola.', 'https://static.openfoodfacts.org/images/products/336/765/100/4229/front_fr.29.400.jpg', '8', '2.5', '23.2', '1.8', '', '11.9', '1.2', '0.47244094488189', '', '0');

