INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651004601', 'Escales Gourmandes Duo de Bacon grillé & fumé, Chèvre', 'Garniture (55 %) : Sauce au _yaourt_ et aux herbes : huile de colza, eau, _yaourt_, vinaigre, amidon transformé de pomme de terre, sauce, jaune d\'_oeuf_, sel, herbes de Provence, épaississants : farine de graine de caroube et gomme xanthane, conservateur : sorbate de potassium. Bacon cuit fumé choix 19 % : viande de porc, sel, dextrose, arôme de fumée, antioxydant : érythorbate de sodium, conservateur : E250. Fromage de chèvre 19 % : _lait_ de chèvre pasteurisé, sel, _ferments lactiques_ et fongiques. Tomate. Bacon grillé 9 % : poitrine de porc, conservateurs : E250, lactate de potassium, sel, arômes (dont arôme de fumée), sirop de glucose, antioxydant : ascorbate de sodium, stabilisant : E450. Salade. Pain de mie spécial campagne (45 %) : Farine de _blé_, eau, farine de seigle, levains issus de farine de seigle et de _blé_ malté, huile de colza, _gluten_, sel, levure, vinaigre, farine de fèves, malt d\'orge, farine de _blé_ malté, extrait d\'acérola.', 'https://static.openfoodfacts.org/images/products/336/765/100/4601/front_fr.7.400.jpg', '9.4', '2.3', '22.8', '2.3', '', '9.8', '1.1', '0.433070866141732', '', '0');

