VALUES ('3367651004960', '1-2-3 Salade Chèvre Lardons sauce bulgare', 'Salade composée 83% : spécialités céréalières cuites 28% (eau, semoule de _blé_ dur, blanc d\'_oeuf_, sel), salade 15M (frisée, mâche, mélange de jeunes pousses en proportions variables), lardon cuit fumé rissolé 8,9% (poitrine de porc, sel, dextrose, arôme de fumée, acidifiant : E330, conservateurs : érythorbate de sodium, E250), _fromage de chèvre_ 8,9% (_lait de chèvre_ pasteurisé, sel, ferments lactique et fongiques, coagulant), carotte 8,2%, tomate mi-séchée, tomate cerise 5,7%, huile de colza, sel, persil, poivre, paprika Vinaigrette allégée en matière grasse au fromage blanc 14% : eau, huile de colza 3,6%, _fromage blanc_ 2,9%, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre d\'alcool, sel, acidifiant : E330), vinaigre d\'alcool, sucre, sel, amidon transformé de maïs, poivre blanc, épaississant : gomme xanthane Croûtons grillés 3% : farine de _blé_, huile de tournesol, gluten de _blé_, sel, sucre, levure', 'https://static.openfoodfacts.org/images/products/336/765/100/4960/front_fr.6.400.jpg', '8.7', '2.4', '12', '2.2', '', '5.8', '0.8', '0.31496062992126', '', '1');

