VALUES ('3367651005059', 'Le Club classique pain complet Poulet rôti crudités', 'Garniture (50 %) : Poulet rôti traité en salaison 37 % : Filet de poulet, eau, acidifiants : lactate et acétate de potassium, dextrose, amidon transformé de pomme de terre, sel, stabilisant : E451, sucre brun, antioxydant : érythorbate de sodium. Crudités 37 % : tomate, salade. Mayonnaise allégée en matière grasse : eau, huile de colza 5 %, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, acidifiant : E330 et antioxydant : disulfite de potassium), jaune d\'_oeuf_, vinaigre, amidon modifié de pomme de terre, sucre, sel, épaississants : gommes guar et xanthane, conservateur : sorbate de potassium (% exprimés sur la garniture) Pain de mie complet (50 %) : farine complète de _blé_, eau, farine de _blé_, huile de colza, levure, sucre, sel, _gluten_ de blé, farine de fèves, émulsifiant : E471, antioxydant : acide ascorbique.', 'https://static.openfoodfacts.org/images/products/336/765/100/5059/front_fr.6.400.jpg', '5.2', '0.5', '24.9', '2.7', '', '8', '1.3', '0.511811023622047', '', '0');

