INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651008005', 'Cheesy', 'PAIN SPÉCIAL TRADITION (48,7% ): farine de blé, eau, huile de colza, sucre, levain (eau, levure, farine de seigle, farine de blé malté), levure, graines 1,9% (graines de millet, graines de lin brun, graines de lin jaune, graines de tournesol, graines de pavot), flocon de blé malté, sel, farine d\'orge malté torréfié, gluten de blé. GARNITURE steak haché cuit de viande bovine origine France de race charolaise 23,1%, sauce condimentaire ketchup moutarde 12,8% [ketchup 10,3% (tomates (132g pour 100g de ketchup), sucre, vinaigre, amidon modifié, sel, arôme naturel d\'épices avec autres arômes naturels), moutarde de Dijon 2,6% ( eau , graines de moutarde, vinaigre, sel, conservateur: sulfite acide de sodium)], emmental fondu fabriqué en France 12,8% (fromages dont emmental 6,4%, beurre, protéines de lait, eau, épaississants : gomme de xanthane farine de graine de caroube, poudre de lait écrémé), cornichons 2,6% [cornichon, saumure vinaigrée (eau, vinaigre d\'alcool, sel, agent de conservation E224)]. (% exprimés sur le produit fini). Informations en gras destinées aux personnes allergiques. Traces éventuelles de poisson, ceuf, crustacé, sésame, céleri, soja, fruits à coque.', 'https://static.openfoodfacts.org/images/products/336/765/100/8005/front_fr.11.400.jpg', '10', '4.9', '28', '4.1', '', '14', '1.2', '0.47244094488189', '', '0');

