INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651008128', 'Maxi moelleux surimi', 'PAIN SPECIAL 54% [farine de blé, ceuf, eau, huile de colza, sucre, levain (farine de blé et de seigle, eau, levure), levure, poudre de lait, gluten de blé, sel, fibre de psyllium, extrait d\'acérola). GARNITURE: surimi de chair de poisson 27.7% [eau, chair de poissons 10.5%, amidons (contient blé), huile de colza, sucre, sel, arôme naturel (contient crustacés), colorant: extrait de paprika], mayonnaise allégée matières grasses 18.5% [eau , huile de colza, moutarde de Dijon (eau, graines de moutarde, vinaigre, sel, acidifiant: acide citrique, antioxydant:disulfite de potassium), jaune d\'ceuf 0.9%, vinaigre d\'alcool, amidon transformé de pomme de terre, sucre, sel, épaississants: gommes guar-gomme xanthane, conservateur :sorbate de potassium]. (% exprimés sur le produit fini). Informations en gras destinées aux personnes allergiques. Traces éventuelles de sésame, céleri, soja et fruits à coque. 3 367651 008128', 'https://static.openfoodfacts.org/images/products/336/765/100/8128/front_fr.4.400.jpg', '11', '1.1', '32', '6.2', '', '7', '1.2', '0.47244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3367651008159', 'Salad Bar Caesar', 'Pates cuites 26% (eau, semoule de blé dur, sel), _oeuf_ dur 16% (oeuf, sel, acidifiants : acide citrique - acide acétique), salade mélangée (frisée, mâche, jeune pousse) 16%, sauce Caesar 14% [eau, huile de colza, _crème fraiche_, _fromage blanc_, _moutarde_ de Dijon (eau, graines de moutarde, viņaigre d\'alcool, sel, acidifiant acide citrique), _fromage_ poudre déshydraté, vinaigre d\'alcool, sel, sucre, amidons transformés de maïs, arôme (_lait_), poivre blanc, ail, épaississant : gomme xanthane], émincés de poulet rôti traité en salaison 9% (viande de poulet origine UE, huile de tournesol, acidifiants: lactate de potassium - acetate de sodium, stabilisants: Algues Euchema transformées - triphosphates, sel, dextrose, amidon de pomme de terre, sucre roux, vinaigre neutralisé), carotte 8%, tomate cerise 6%, fromage Grana Padano 3% (_lait_ de vache cru, sel, présure animale, conservateur : lysozyme d\'oeuf), eau, huile de colza, tomate déshydratée, ferments, graine de pavot, basilic. 60% de matières grasses en moins par rapport à un assaisonnement classique à 75% de matières grasses. Traces éventuelles de crustacé, poisson, céleri, soja, graine de sésame, fruit à coque.', 'https://static.openfoodfacts.org/images/products/336/765/100/8159/front_fr.4.400.jpg', '7.4', '1.9', '9.2', '1.7', '', '7.5', '0.63', '0.248031496062992', '', '1');

