VALUES ('3367651900071', 'Le Moelleux Pain viennois Jambon', 'BAGUETTE VIENNOISE (56 %) : farine de _blé_, eau, huile de colza, sucre, _oeuf_, levure, sel  _gluten_ de blé, farine de _blé_ malté, extrait d\'acérola, curcuma. GARNITURE (44 %) : Jambon cuit choix 26 % : jambon de porc, eau, sel, dextrose, sirop de glucose, arômes, stabilisants : E451-E450, antioxydant : érythorbate de sodium, conservateur : E250, Mayonnaise allégée en matières grasses 26 % : eau, huile de colza 5,2 %, _moutarde_ de Dijon (eau, graines de _moutarde_, vinaigre, sel, acidifiant : E330, antioxydant : disulfite de potassium), jaune d\'_oeuf_, vinaigre, amidon transformé de pomme de terre, sucre, sel, épaississants : gommes guar et xanthane, conservateur : sorbate de potassium, _Emmental_ 21 %, Jambon de pays 16 % : jambon de porc, sel, dextrose, conservateur : E252. Salami 11 % : viande et gras de porc, sel, dextrose, épices, sirop de glucose, ail en poudre, antioxydant : ascorbate de sodium, ferment, conservateur : E250, colorant : cochenille.', 'https://static.openfoodfacts.org/images/products/336/765/190/0071/front_fr.6.400.jpg', '10.4', '2.8', '31', '4.2', '', '12.1', '1.7', '0.669291338582677', '', '0');

