VALUES ('3368952471864', 'Croquant Praliné', 'Crème (CREME, stabilisant : carraghénanes), pâte au praliné 17% [praliné 16% (sucre, NOISETTE, AMANDE), huile de tournesol, sucre, émulsifiant : lécithine de SOJA], crème anglaise (LAIT écrémé, sucre, CREME, amidon transformé de maïs, jaune d\'OEUF, arôme, stabilisants : citrates de sodium et carraghénanes, émulsifiant : mono et diglycérides d\'acides gras, sel, colorant : caroténoïdes), sucre, OEUF entier, chocolat noir 5% (pâte de cacao, sucre, beurre de cacao, émulsifiant : lécithine de SOJA), eau, huile de tournesol, farine de BLE, riz soufflé caramélisé 2% (riz soufflé, sucre, sucre caramélisé, huile de tournesol, miel), préparation gélifiante (sucre, gélatine bovine, amidon de pomme de terre, épaississants : gomme xanthane et gomme guar), sirop de glucose, cacao en poudre 1% , pâte de NOISETTE 1% , purée d\'abricot (abricot, sucre, antioxydant : acide ascorbique), extrait de café, préparation émulsifiante [émulsifiants : mono et diglycérides d\'acides gras et esters polyglycériques d acides gras, eau, humectant : sorbitols (dont BLE), stabilisant : propylène glycol], sirop de sucre inverti, préparation gélifiante (gélifiant : pectines, stabilisants : diphosphates et phosphates de calcium, dextrose), acidifiant : acide citrique. Soit 50% de mousse au praliné amande-noisette, 25% de croquant au chocolat noir au riz soufflé et 12% de biscuit dans le produit. Traces éventuelles d\'arachides et autres fruits à coques.', 'https://static.openfoodfacts.org/images/products/336/895/247/1864/front_fr.18.400.jpg', '22.4', '9.5', '30.3', '22.5', '2.3', '5.8', '0.13', '0.0511811023622047', '', '0');

