INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3368952659668', 'Poulet basquaise au piment d\'Espelette U LES SAVEURS', 'POULET BASQUAISE CUISINE AU PIMENT D\'ESPELETTE INGREDIENTS: Cuisses de poulet assaisonnés 51% (cuisses de poulet, sel, ail déshydraté), tomates concassées 19,5% (tomates pelées concassés, jus de tomates), tomates entières pelées 10,9%, poivrons rouges et verts 7,2%, oignons, sucre, amidon ransformé de pomme de terre, purée de tomates double Concentrée, huile d\'olive vierge extra 0,7%, sel, ail déshydraté o, 03%, persil, thym, piment d\'Espelette o,01%. CONSEILS DE PRÉPARATION Au bain-Marie plongez le bocal ouvert pendant 15 minutes environ dans de l\'eau bouillante à mi-hauteur. Au four à micro-ondes versez le contenu du bocal dans un plat adapté, couvrez et faites réchauffer 7 minutes à puissance moyenne. MODE DE CONSERVATION A conserver à l\'abri de la chaleur et de l\'humidité. Après Ouverture, doit être conservé au réfrigérateur et consommé rapidement. A consommer de préférence avant le: voir sur le eouvercle. Poids net: 760g 8996', 'https://static.openfoodfacts.org/images/products/336/895/265/9668/front_fr.7.400.jpg', '6.8', '2.1', '5.2', '3.5', '', '9', '1.4', '0.551181102362205', '', '0');

