VALUES ('3368952660015', 'Bûche glacée, caramel vanille pécan', 'Crème glacée au caramel 62.8% : eau, crème fraîche, caramel aromatique 15%* (sucre, eau, sirop de glucose de blé), lait écrémé reconstitué, préparation, préparation laitière (lactose, protéines de lait, sirop de glucose de blé), sucre, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de caroube guar, colorant : caramel au sulfite d\'ammonium, arôme.   Crème glacée à la vanillle avec des inclusions de noix de pécan pralinées 24.4% : eau, lait écrémé réhydraté, sirop de glucose-fructose de blé, noix de pécan pralinées 12.8%* (noix de pécan 60%, sucre), crème fraîche, sucre en poudre de lactosium, émulsifiant : mono et diglycérides d\'acides gras, gélifiants : farine de graines de caroube - gomme guar, gousses de vanille épuisées broyées0.2%*, arôme naturel de vanille, sirop de glucose caramélisé, colorants : curcumine - rocou. * Pourcentages exprimés sur la crème glacée à la vanille. Fond de succès aux amandes 5.8% : sucre, blancs d\'oeufs, poudre d\'amande 20%*, farine de blé. * Pourcentage exprimés sur le fond de succès aux amandes. Sauce au caramel 5.2% : saccharose, eau, sirop de glucose-fructose de blé ou de maïs, caramel au lait 7%*, lait concentré non sucré, caramel 4%*, épaississants : amidon modifié de maïs - carraghéanes, beurre, arômes, correcteur d\'acidité : acide lactique, colorant : caramel de sulfite caustique, conservateur : sorbate de potassium, exhausseur de goût : sel. * Pourcentrages exprimés sur la sauce caramel. Décor 1.8% : Sauce au caramel 47.7%* : saccharose, eau, sirop de glucose-fructose de blé ou de maïs, caramel au lait 7%, lait concentré non sucré, caramel 4%*, épaississants : amidon modifié de maïs - carraghénanes, beurre, arômes, correcteur d\'acidité : acide lactique, colorant : caramel de sulfite caustique, conservateurs : sorbate de potassium, exhausteur de goût : sel. Noix de pécan pralinées 22.7%*, : noix de pécan 60%, sucre. Eclats de caramel 17.1%* : sucre, sirop de glucose de blé, crème  24%, beurre 20%, Demi-boule en chocolat blanc 12.5%*, sucre, beurre de cacao, lait entier en poudre, arôme naturel de vanille, colorant : oxyde et hydroxyde de fer. *Pourcentages exprimés sur le décor.', 'https://static.openfoodfacts.org/images/products/336/895/266/0015/front_fr.6.400.jpg', '9.78', '5.08', '28.76', '23.88', '0.38', '2.44', '0.1524', '0.06', '', '1');

