VALUES ('3368954085793', 'Mini nems au porc', 'mini-nems porc et légumes 100g: eau, farine de riz 16%*, viande de porc (origine France) 10%*, pousses de haricots mungo 9.8%*, vermicelle de pois réhydraté, oignons 5.8%*, carottes 5.2%*, gras de porc (origine France) 4.1%*, protéines de SOJA, champignons noirs réhydratés 2.3%*, sauce SOJA (eau, graines de SOJA, sel, farine de BLE), huile de tournesol, sel, caramel (sucre, eau), émulsifiant: lécithine de SOJA, arôme naturel, poivre. Friture : huile de tournesol. *Pourcentages exprimés sur les mini-nems. Sauce au nuoc-mâm 30g: eau, sucre, sel, vinaigre d\'alcool, nuoc-mâm 3,5%** (ANCHOIS (Stolephorus spp.), sel, eau), sauce SOJA (eau, graines de SOJA, sel, farine de BLE). **Pourcentage exprimé sur la sauce. Traces éventuelles de crustacés, OEUFS, LAIT, fruits à coques, céleri, moutarde, graines de sésame, lupin et mollusques.', 'https://static.openfoodfacts.org/images/products/336/895/408/5793/front_fr.39.400.jpg', '9.5', '2.3', '21', '4.3', '2', '4.7', '2', '0.78740157480315', '', '0');

