VALUES ('3368954395014', 'Assortiment pour café gourmand', '4 financiers carrés à la pomme : pommes poêlées caramélisées 18,8% (pomme 16%, sucre, caramel (sucre, eau), BEURRE, eau), sucre glace, BEURRE 2,8%, AMANDE en poudre 2,4%, blanc d\'OEUF pasteurisé, fécule de pomme de terre, farine de BLE, NOISETTE en poudre 0.9%4 entremets croustillants à la framboise : purée de framboise 9,2% (framboise 8,2%, sucre), chocolat blanc (sucre, beurre de cacao, poudre de LAIT entier, émulsifiant : lécithine de SOJA, arôme naturel de vanille), framboise 5,5%, biscuit (OEUFS entiers, sucre, farine de BLE, eau, poudre d\'AMANDE, émulsifiant : mono et diglycérides d\'acides gras, farine de pois, poudres à lever : diphosphates et carbonates de sodium, fécule de pomme de terre, protéines de LAIT), brisure de crêpe dentelle 2,8% (farine de BLE, sucre, BEURRE concentré, LAIT écrémé en poudre, farine d\'ORGE malté, sel), sucre, beurre de cacao, huile de tournesol, eau, gélifiant : pectine, arôme naturel de framboise.4 macarons au chocolat : sucre glace, AMANDE en poudre 5%, blanc d\'OEUF, crème (CREME, stabilisant : carraghénanes), chocolat noir de couverture 3% (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de SOJA, arôme naturel de vanille), chocolat de couverture 1,2% (pâte de cacao, sucre, beurre de cacao, lécithine de SOJA, extrait de vanille), eau, sirop de sucre inverti, poudre de cacao maigre 0,6%, sucre, blanc d\'OEUF en poudre.Pourcentages exprimés sur le produit fini. Traces éventuelles de graines de sésame et autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/336/895/439/5014/front_fr.27.400.jpg', '18', '7.8', '41', '34', '5.6', '5.6', '0.16', '0.062992125984252', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3368954395021', 'Mignardises x16', '4 mini éclairs au chocolat : LAIT demi-écrémé stérilisé, préparation pour glaçage (sucre, eau, sirop de glucose, émulsifiant : mono et diglycérides d\'acides gras, épaississants : agar agar, farine de graines de caroube), chocolat noir de couverture 3% (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de SOJA, arôme naturel de vanille), sucre, OEUF entier, farine de blé (farine de BLE, GLUTEN de BLE), eau, jaune d\'OEUF, BEURRE, pâte de cacao, beurre de cacao, amidon transformé de manioc, gélifiant : carraghénanes, sel. 4 entremets framboise mascarpone et noix de coco : fourrage à la framboise 7,9% (sucre, brisure de framboise 2,2%, purée de framboise 2,2%, jus de citron, gélifiant : pectine), biscuit à la noix de coco 5,3% (OEUF entier, sucre, farine de BLE, poudre de noix de coco 0,6%, eau, huile de colza, poudre de LAIT, poudres à lever : disphosphates, carbonates de sodium), chocolat blanc (sucre, beurre de cacao, poudre de LAIT entier, émulsifiant : lécithine de SOJA, arôme naturel de vanille), crème (CREME, stabilisant : carraghénanes), LAIT demi écrémé, mascarpone 1,1% (CREME, correcteur d\'acidité : acide citrique), jaune d\'OEUF, sucre, huile de tournesol, brisure de crêpe dentelle (farine de BLE, sucre, BEURRE concentré, LAIT écrémé en poudre, farine d\'ORGE malté, sel), noix de coco râpée 0,4%, beurre de cacao, eau, gélifiant : pectine. 4 tartelettes au citron et meringue : fond de tartelette sucré 7% (farine de blé (farine de BLE, GLUTEN de BLE), BEURRE 1,5%, sucre glace, OEUF entier, eau, fibre de BLE, fécule de manioc), nappage (eau, sucre, sirop de glucose-fructose, gélifiants : pectine et carraghénanes, acidifiant : acide citrique), OEUF entier, purée de citron 2,5% (citron 2,2%, sucre), sucre, BEURRE, chocolat blanc (sucre, beurre de cacao, poudre de LAIT entier, émulsifiant : lécithine de SOJA, arôme naturel de vanille), brisure de meringue 0,9% (sucre, blanc d\'OEUF), beurre de cacao, fécule de pomme de terre, jaune d\'OEUF, chocolat de couverture (pâte de cacao, sucre, beurre de cacao, lécithine de SOJA, extrait de vanille), gélifiant : carraghénanes. 4 tartelettes au caramel et nougatine : caramel au BEURRE et au sel de Guérande 8,4% (sirop de glucose-fructose, confiture de lait [LAIT entier, sucre, LAIT écrémé en poudre], BEURRE 1,4%, sucre, eau, LAIT entier en poudre, sel de Guérande 0,04%, jus de citron), fond de tartelette sucré 7,2% (farine de blé (farine de BLE, GLUTEN de BLE), BEURRE 1,6%, sucre glace, OEUF entier, eau, fibre de BLE, fécule de manioc), crème (CREME, stabilisant : carraghénanes), brisure de nougatine 1,6% (sucre, AMANDE 0,8%), chocolat blanc (sucre, beurre de cacao, poudre de LAIT entier, émulsifiant : lécithine de SOJA, arôme naturel de vanille), beurre de cacao, chocolat de couverture 0,2% (pâte de cacao, sucre, beurre de cacao, lécithine de SOJA, extrait de vanille), amidon transformé de manioc, fécule de manioc.Pourcentages exprimés sur le produit fini. Traces éventuelles de graines de sésame et autres fruits à coque', 'https://static.openfoodfacts.org/images/products/336/895/439/5021/front_fr.29.400.jpg', '24', '14', '41', '28', '3.5', '5.5', '0.35', '0.137795275590551', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3368954396264', 'Poêlée terre et mer aux crevettes gambas chorizo', 'Pâte alimentaire gigli précuite 43,3% (eau, semoule de BLE dur), eau, CREVETTE gambas décortiquée crue 15% (Penaeus vannamei, elevée au Pérou ou au Vietnam), CREME fraîche, chorizo 5% [viande et gras de porc (France), piment doux, LACTOSE, sel, dextrose, épices, antioxydant : ascorbate de sodium, ferments], lait de coco 2% (extrait de noix de coco, eau), LAIT écrémé en poudre, farine de BLE, huile de tournesol, sel, basilic 0.2%, purée d\'ail, arôme natuel, paprika, piment fort, thym, épices. Soit 36,7% de sauce au lait de coco dans le produit.', 'https://static.openfoodfacts.org/images/products/336/895/439/6264/front_fr.25.400.jpg', '4.6', '2.4', '15', '1.2', '1.8', '6.8', '0.56', '0.220472440944882', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3368954396349', 'Poêlée pad thai au poulet et nouilles de riz', 'Eau, morceau de filet de poulet traité en salaison cuit 15% [filet de poulet (France), sel, dextrose, amidon de pomme de terre], nouille de riz 15% (riz, tapioca, eau, sel), oignon 12%, champignon noir 10%, carotte 8%, huile de tournesol, omelette brouillée 3% (OEUF entier, LAIT écrémé reconstitué, huile de colza, farine de maïs, sel, jus de citron concentré), ail, pousse de haricot mungo, sauce soja (eau, SOJA, BLE, sel, vinaigre d\'alcool, alcool, sucre), graisse de poulet (graisse de poulet, antioxydant : extrait de romarin), graine de SOJA 1%, CACAHUETE grillée à sec en morceaux, préparation à base de piment (piment, purée de tomate, eau, sel, poivron, vinaigre d\'alcool), sauce de poisson (POISSON, sel, eau), amidon transformé de maïs, ciboule, basilic thaï, piment fort. Soit 30% de sauce dans le produit. Traces éventuelles de céleri, fruits à coque et moutarde.', 'https://static.openfoodfacts.org/images/products/336/895/439/6349/front_fr.29.400.jpg', '4.8', '0.8', '16', '2.7', '1.3', '5.7', '0.84', '0.330708661417323', '', '1');

